import React from 'react';
import quotes from '../quotes.json'

const Quotebox = () => {
    return (
        <div id="fondo">
            <div id="tarjeta">
                <p>{quotes[0].quote}</p>
                <p>{quotes[0].author}</p>
                <button id="boton"> <i class="fad fa-greater-than"></i></button>
            </div>
        </div>
    );
};

export default Quotebox;
